(19068, 'D6322C32-DCAB-4DAA-96F4-61356F403945', 'While there are many milestones to celebrate along the road, I️ didn’t want the day to pass without saying how grateful I️ am to be married to you. 4 years ago, we made our love official to the IRS, just a few weeks after Orli was born. Looking at those pictures this morning was a treat. I️ remember getting so emotional when the justice of the peace asked us to share what we love about one another. While I️ can’t remember what I️ said specifically that day (who could given that Orli was three weeks old), here’s what I️ would say today. I️ love your giggle and hearing you laugh when Orli says something funny. I️ love your passion for music and I️ enjoy watching you, from afar, conjure up new lyrics and take so much pleasure in delving into the instruments and layering in the sounds. I️ love your passion for reading and keeping your mind active. I️ love discussing what’s in your head as you mull over ideas and thoughts that capture you. I️ love that you have delved into race in a deeper way over the last few years as the climbers have become a deeper part of our lives. I️ love watching you bond with Orli as you build towers, prep for movie night, or grow oranges in the backyard. I love that you have found ways to stay connected to the boys after they have moved away. I️ love that you have refound my boobs and have learned just the right level of squeeze to get my entire body juiced to the max. I️ appreciate your belief in me as a leader, a CEO, and a woman. I️ appreciate the ways in which you engage in my work and celebrate successes. I️ appreciate your commitment to growth and development. I️ have seen you go so so so deep in the last 4 months as you grappled with really hard stuff - with us, with me, and with yourself. You have shown up in spades to do this work and I️ am forever grateful. You’re a more thoughtful and more engaged partner despite a very very rough patch. I️’m in awe of your commitment to us and to your commitment to self growth. I️’m so very lucky to have you and whatever love I️ felt for you four years ago, I️ only feel it 10x more today. I️ think that’s how it’s supposed to go and it’s what people wish on their wedding days. But many couples don’t experience that deeper level of love years later, with kids and the rigamarole of life. Thankfully, I️ have a partner who continues to invest in us, even through the hardest moments. Thank you my love for being you. I️ adore you in every way.', '630818200261408512', '630823267761538944', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'e:nwdave@b-zb.com', '+19172390518', '2020-12-27T19:16:40.261409'),
(19086, '69334793-C752-49B9-AB22-CEF53D48421D', 'I know that cleaning up my crap is one way I can speak your love language. But that wasn’t the thing I was thinking about this morning as I was. Cleaning up i’ve been thinking about new ways of exploring play and pleasure with you. And how specially in Covid times this is been in short supply elsewhere. I love the way your eyes crinkle up when you laugh and smile and you get a little giggle. I love the way you have discovered edibles and how even though you use them as a way to turn off your brain you can’t help asking for five times with your brain while eating edibles with her I am as altered as you are at any given moment. And I love how you discovered having sex while on edibles and how you laugh with joy afterwards as If you discovered how awesome it feels to have an orgasm for the first time. If  covid has taught anything it is that it is up to us discover and cultivate moments of joy. And while we’ve had our share of hard moments the past few months I have worked hard to overcome the most difficult part of our relationship it is with a renewed Curiosity that I want to find new ways to experience joy and pleasure together with you.Whether that means Nitzan in Paris, Or Nissan in Disneyland or needs son in handcuffs, I’m game', '630882934196114560', 'None', 1, 'David', 'Nitzan', 0, '', '', '', 'iMessage', 'e:nwdave@b-zb.com', 'David', '2020-12-28T13:15:34.196115'),
