(19302, '695A21A5-C458-4DA6-B879-817320351FC9', 'This book was uncannily good - perceptive and prescient about the Bay Area’s dizzying run from “short-lived utopia...toward a late-capitalist hellscape.”   It’s part 20-something memoir (“the twinge of homesickness”, “a call back to the childhood nausea of being left out”, arriving in a new city “feeling free, invisible and very lonely”) - and part straight-up critique of our collective delusion with what Weiner calls “tech’s dark triad: capital, power and a bland, overcorrected heterosexual masculinity.”  Weiner describes a City (or really, a moment) where small talk was always prelude to the pitch; revenue graphs looked like cartoons of revenue graphs; startups were named for URL availability (not posterity or history). And amidst the intoxicating momentum, ironically, “everyone on the train looked tired, resigned sheepish; mostly, they looked at their phones.”  Most poignant to me is her description of the seductive optimization of....everything: workflows, time, relationships, bodies.  I feel this tug fiercely and struggle to resist the trap; not a day goes by that I don’t judge myself for prioritizing productivity over presence, efficiency over enjoyment.   But what if this is not a personal shortcoming, but actually a global affliction? And do we really want to win at this game?! “The fetishized life without friction: What was it like? An unending shuttle between meetings and bodily needs? A continuous productive loop?”  “I liked my inefficient life.  I liked listening to the radio, long showers and stoned museum wandering; riding public transportation, watching strangers stare at the sunset and at photos of the sunset on their phones.  Folding the laundry, copying keys, engaging with strangers. Having one last drink.  Warm laundry, waiting for the bus.  I could get frustrated, overextended, overwhelmed, uncomfortable.  Sometimes I ran late.  But these banal inefficiencies -- I thought they were luxuries, the mark of the unencumbered....”   Here’s to reclaiming and delighting in inefficiency - not as laziness, weakness - but as subversion. As resistance.  Inhabiting our whole & messy humannesss like our lives depend on it. Because they probably do.', '631259498724204800', 'None', 0, 'Nitzan', 'David', 0, '', '', '', 'iMessage', 'e:nwdave@b-zb.com', '+19172390518', '2021-01-01T21:51:38.724205'),
